INSERT INTO `episodio` (`id`, `numEpisodio`, `numTemporada`, `sinopsis`, `fechaInicio`, `titulo`, `idSerie`) VALUES
(7, 1, 1, 'Los nuevos vecinos comienzan a mudarse a Mirador de Montepinar, \nun espléndido inmueble de reciente construcción. \nJavi, el joven presidente de esta comunidad, regresa junto a su esposa Lola de la luna de miel y se encuentra\n con numerosos problemas: los vecinos no pagan las cuotas, el conserje se ha despedido y la constructora\n no se pronuncia a la hora de arreglar los desperfectos de la obra. En su misión le ayuda Leo, \nel vicepresidente considerado el pesado del edificio. El matrimonio formado por Enrique y Araceli -él concejal \ny ella dueña de la peluquería de la finca- se trasladan a su nueva residencia junto a Fran, su hijo adolescente, \ny doña Charo, la madre de Araceli. Pronto se producen las primeras disputas entre este clan, \nlos Pastor-Madariaga, y sus vecinos de arriba, los Recio. Sumergida en una profunda crisis emocional \ntras ser abandonada un mes antes de casarse, Cris vende su piso recién comprado y vive en alquiler en la \nsegunda vivienda de los Recio. La llegada de Sergio Arias, un famoso actor de culebrón a quien su hermano \nJoaquín le ha vendido un flamante ático, convulsiona la vida de la comunidad. Después de ser contactado por\n Leo en Internet, Maxi se incorpora como conserje de la finca, a la que llega con su caravana. \nAdemás, Coque, un recluso en régimen abierto, es contratado como jardinero. \nLos últimos en mudarse son Izaskun y Mari Tere, dos amigas fugadas de una residencia que se convierten en\n las okupas del piso piloto, y Goya y Vicente, un matrimonio de jubilados que se trasladan al complejo para \nestar junto su hijo Javi, a quien han ocultado esta decisión. ', '2007-06-12', ' Mirador de Montepinar ', 3),
(8, 2, 1, 'Tras recibir múltiples súplicas de los vecinos, Raquel, la atractiva directora comercial de la empresa \nconstructora acude al Mirador de Montepinar para revisar los desperfectos de obra de las viviendas. \nEn el transcurso de su visita, conoce a Sergio, con quien vive una noche de pasión. ', '2007-06-19', ' Okupas, flechazos y golpe en el garaje ', 3),
(9, 3, 1, 'Maite es testigo de cómo Eric entrega los azulejos a Enrique y Araceli. \nLa noticia corre como la pólvora por el edificio y poco después los airados vecinos se quejan a Raquel, que l\nes promete una reunión con el máximo responsable de la constructora. Tras perder la paciencia,los\n residentes del inmueble están dispuestos a invadir las obras de la segunda fase para conseguir las losetas. \nIzaskun y Mari Tere se hacen con el cadáver de una mujer que ha fallecido repentinamente en la peluquería \npara disuadir a una pareja interesada en entregar la señal para comprar el piso piloto. Joaquín espera la visita\n de una joven con la que ha iniciado un romance en Internet. Sergio y Eric le convencen de que seguro que es \nmuy fea y Joaquín huye del aeropuerto dejando solo a Sergio. La chica resulta ser muy atractiva, por lo que el \ngalán televisivo no duda en suplantar a Joaquín para conquistarla. Vicente compra en la tele-tienda un juguete\n sexual y pide que se lo envíen al domicilio de su hijo Javi. Pero es Lola quien recibe el paquete. Consciente \nde los numerosos secretos y mentiras de los vecinos, Maxi roba un polígrafo para prestar sus servicios de \ndetección de mentiras a todos los interesados a cambio de una contraprestación económica. ', '2007-06-26', 'Azulejos, un polígrafo y un paquete por correo', 3),
(10, 1, 2, 'Tras una más que sospechosa depresión de Javi, Amador se convierte en el nuevo presidente del complejo \nresidencial y Maite, feliz con el nombramiento de su marido, debuta como ''primera dama'' del edificio. Leo\n permanece al frente de la vicepresidencia del inmueble. La primera iniciativa que emprende el nuevo \nmandamás será la de despedir al conserje, al que no soporta. Lola, orquestadora en la sombra de la falsa \nenfermedad de Javi, está ansiosa por disfrutar de su chico a tiempo completo, hasta que descubre que su \nmarido desea tener hijos lo antes posible. Tal es su deseo de ser padre, que el ex-presidente pide a Amador \ny a Maite que le presten a sus hijos temporalmente. ', '2008-09-21', 'Un soltero, un presidente y un yogur con fibra ', 3),
(11, 2, 2, 'Fran ha copiado en un exámen y la profesora quiere hablar con su padre, cuando lo hacen Enrique ejerce una\n fuerte atracción sobre la profesora que llegará a perdonar todos los pecados de su alumno a cambio de \nalgunos ''favores''. Por otro lado, Goya está harta de su marido y se quiere echar un amante. Joaquín quiere \ndemostrar a su hermano que no es gay y casualmente se encuentra con Goya en el ascensor. Entre los dos \nsurge una chispa y no se pueden contener. Lola y Javi han invitado a cenar a Sergio y Joaquín, que se queda \nhelado cuando su nuevo ligue se presenta dispuesta a compartir la velada. ', '2008-09-28', 'Un suspenso, una psicosis y un romance inconcebible ', 3),
(12, 1, 1, 'Tras la muerte de su padre, Aída y sus dos hijos regresan a su barrio de toda la vida. Ha heredado su vivienda, algo que le enfrenta a su madre quien, además, cree que la ingresará en una residencia.', '2005-01-16', 'Una nueva vida', 4);

